import {Nav, Navbar, Container} from 'react-bootstrap'
import React, { useState } from "react";
import {Route, Routes, useNavigate, useParams} from 'react-router-dom'

function SignUp(){
    return(
        <div className='todo-container'>
            <h1 style = {{fontSize : 50}}>Welcome to Ho-Do List!</h1>
            <div style={{textAlign : "center",  marginTop: 20}}>
                <form action='/add' method='POST'>
                    <input
                    type="text"
                    placeholder="Enter a task..."
                    name='title'
                    style={{dislplay: 'inline-block',fontSize: 20, height: 50}}
                    />
                    <input
                    type="text"
                    placeholder="Date(YYMMDD)"
                    name='date'
                    style={{fontSize: 20, height: 50}}
                    />
                    <button className = 'purpleButton' style = {{width:"10%", height:50, fontSize:20, display: 'inline-block'}} 
                    type = 'submit'>Add</button>
                </form>
            </div>
        </div>
    )
}


export default SignUp
